query:
{
  iamAccountSummaries(
    where: {
      hasIAMAccountSummaryItem_SOME: { key: "antiDDoSHasLogStore", value: 1 }
    }
  ) {
    connector {
      identifier
      accountID
      cloudAccountID
      cloudAccountName
      cloudProvider
      idFromProvider
      internalAssetType
      internalName
      internalRegion
      assetCategory
      contentHash
    }
  }
}
